import * as React from 'react';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import { Typography } from '@mui/material';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';

const DashboardPage = () => {
    return (
        <div>
            <Stack direction="row" spacing={2} justifyContent="space-between" alignItems="center" sx={{ margin: '1rem 1rem 0 1rem' }}>
                <Typography sx={{ fontSize: '2rem', color: '#185382' }}>Dashboard</Typography>
                <Button variant="contained" sx={{ backgroundColor: '#185382' }}>Daily Stand-up Meeting</Button>
            </Stack>
            <Box sx={{ flexGrow: 1, marginLeft: '1rem' }}>
                <Grid container spacing={2}>
                    <Grid item xs={4}>
                        <Grid item xs={6}>
                            <Typography>Image 1</Typography>
                        </Grid>
                        <Grid item xs={6}>
                            <Typography>Image 2</Typography>
                        </Grid>
                    </Grid>
                    <Grid item xs={8}>
                        <Typography>Project</Typography>
                    </Grid>
                </Grid>
            </Box>
        </div>
    );
}
export default DashboardPage
